import React, { Component } from 'react';

const vitamins = (props) => {
  return(
    <div>

    <progress id="progressBar" min="0" max="100" value="0"></progress>

    <button onClick={props.addOne}>Add 1</button>

  </div>
  )
}

export default vitamins;
